class ListNode(object):
     def __init__(self, x):
         self.val = x
         self.next = None


class Solution(object):
    def buildList(self, lst):
        head = ListNode(lst[0])
        p = head
        for value in lst[1:]:
            p.next = ListNode(value)
            p = p.next
        return head

    def dispList(self, head):
        while head:
            print(head.val)
            head = head.next

